import React, { useEffect } from 'react';
import { withRouter } from 'react-router-dom';


const Details = () => {
    let params = withRouter();

    useEffect(() => {
        window.scrollTo(0, 0);
        edituserlist(params.ids);
    }, []);
    return (
        <div>Details</div>
    )
}

export default Details
